queries.content:
fragment ventureFields on Venture {
  id
  logoUrl
  projects {
    id
    product {
      id
      ...on DomainProduct {
        dns {
          hostingProvider
          emailProvider
          hosting_ip
          email_ip
        }
        isListedForSaleByOwner
      }
      ...on ExternalProduct {
        type
        entitlementsBlob
        planType
        status
        properties
        billing {
          id
        }
      }
      ...on WebsiteProduct {
        type
        entitlementsBlob
        domainName
        businessName
        status
        isPublished
        planType
        properties
        data
        createDate
        homepageId
        options
        websiteSessionStats {
          last12Months
        }
        billing {
          id
        }
        backgroundImage
      }
      ...on WordpressProduct {
        accountStatus
        id
        maxSites
        sites {
          blogTitle
          siteUid
          manageWpSiteId
          cName
          ipAddress
          status
          published
          sslCertificateId
          entity {
            features {
              isDomainAttached
              domain
            }
          }
        }
      }
      ... on AllAccessPassProduct {
        domainCreditAvailable
      }
    }
    group
    created
    status
    billing {
      id
      plan
    }
    accessed
    domain
    domainUnicode
    domainPunycode
    subscription {
      id
      autoRenew
      canBeRenewed
      commonName
      offerPlan
      paidThroughDate
      productName
      status
      entitlements {
        status
        prePurchaseKeyMap {
          custom_data {
            dify_website
          }
        }
      }
    }
  }
  profile {
    aapOnboarded
    aiOnboarded
  }
}

query getVentureHomeDataAllDashboard {
  user {
    ventures {
      ...ventureFields
      profile {
        name
        aapOnboarded
        aiOnboarded
        metadata {
          createdAt
          updatedAt
        }
      }
    }
    projectCounts (groups:[
      domain
      gdpayments
      olstore
      productivity
      qsc
      shield
      sslcert
      sslmanage
      vnext
      woosaas
      wordpress
      wst7
    ])
  }
}

